            if(compinentMounted){
                setData(await response.clone().json());
                setFilter(await response.json());
                setLoading(false);
                console.log(filter);
            }
        }
        return () => {
            compinentMounted = false
        }

        getProducts()
    }, [])

    return (
        <div>
            <div className="container">
